import React from 'react';

function ManageStudents() {
  return (
    <div>
      <h2>إدارة الطلاب</h2>
      <p>هنا يمكنك إضافة وتعديل بيانات الطلاب.</p>
    </div>
  );
}

export default ManageStudents;
